import React from 'react';
import NextVideoData from '../../data/videos.json';
import NextVideos from './NextVideos';
import './next-videos.scss';

function NextVideoSection() {

    const videoDataJsx = NextVideoData.map((element, index) => {
        return <NextVideos videoData ={element} key={'video' + index} />;
    })

    console.log(videoDataJsx)

    return (
        <section className="next-videos">
            <h2>NEXT VIDEOS</h2>
            {videoDataJsx}
        </section>
    )
}

export default NextVideoSection
